import React from 'react';
import Header from '../Header/Index';
import Table from './'
import {Row,Col} from 'antd';
const Index=(props)=>{
    return (
        <div>
              <Row>
                <Col flex={1}><Header e={3} /></Col>
                <Col flex={4}><Table /></Col>
            </Row>
        </div>
    );
}

export default Index;
